import React from 'react'

const Navbar = () => {
  return (
    <div className='navbar'>
        <div className='container'>

            <div className='logo'><img src=".\images\WordPress_blue_logo.svg.png" alt="Logo" /></div>
            <div className='links'> Links</div>

        </div>
    </div>
  )
}

export default Navbar
